  [],\n\t\"revision_timestamp\": \"2015-05-07T03:51:10.857204\",\n\t\"name\": \"integration-of-tactical-departure-scheduling-and-traffic-flow-management-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In the ATM Select topic area of Integrated
  Arrival, Departure and Surface (IADS) planning, this proposal addresses Tactical
  Departure Scheduling (TDS), which is a commonly used procedure in the NAS. It is
  estimated that approximately 60,000 flights each month are subject to tactical delays
  via TDS, which is approximately 3.5 times the number of flights that are impacted
  by strategic Traffic Management Initiatives (TMIs).  Despite recent advances in
  tactical departure scheduling like that demonstrated in NASA's Precision Departure
  Release Capability (PDRC), little is currently known about the overall effect on
  the NAS when implementing tactical events.  In fact, today no comprehensive guidance
  exists for FAA personnel to determine which TMI to use for a particular traffic
  problem, the duration of that TMI and the recommended control parameters. rnAn integrated
  decision support capability is needed to provide ATM specialists and flight operators
  with information to support planning and decision-making about tactical and strategic
  TMIs. The significant challenge that exists in providing this decision support capability
  is the uncertainty of prediction of both demand and capacity.rnTo address this current
  shortfall of the National Airspace System (NAS), Mosaic ATM proposes to conducted
  detailed research on the interrelationship between IADS scheduling and metering
  capabilities and other TMIs. The output of this research will be both mathematical
  and simulation models that characterize and quantify the relationship between IADS
  capabilities and other TMIs. These models will provide guidance and input for further
  NASA research efforts and activities, and they will also provide real-time operational
  decision support for Traffic Management Coordinators (TMCs) and other ATC specialists.\",\n\t\"license_title\":
